import React from 'react';
import { Input, Space } from 'antd';

import './App.css';

function SearchTool() {
    const { Search } = Input;
    const {  AudioOutlined  } = icons;

    const suffix = (
    <AudioOutlined
        style={{
        fontSize: 16,
        color: '#1890ff',
        }}
    />
    );

    const onSearch = value => console.log(value);
    
    
    // //mountNode,
    
    return (
        <div className="srearch-tool">
            <Space direction="vertical">
                <Search placeholder="input search text" onSearch={onSearch} enterButton />
                <Search
                placeholder="input search text"
                allowClear
                enterButton="Search"
                size="large"
                onSearch={onSearch}
                />
                <Search
                placeholder="input search text"
                enterButton="Search"
                size="large"
                suffix={suffix}
                onSearch={onSearch}
                />
            </Space>,
        </div>
        );
}

export default SearchTool;
